import React from "react";
import styled from "styled-components";
import { IconGithub } from "icons"; // GitHub 아이콘
import MailOutlineIcon from "@mui/icons-material/MailOutline"; // Material Icons 이메일 아이콘

const Box = styled.div`
  display: flex;
  align-items: flex-start;
  width: 1040px;
  border: 1px solid black;
  box-sizing: border-box;
`;

const Image = styled.div`
  height: 250px;
  width: 250px;
  border: 1px solid black;
  box-sizing: border-box;
`;

const Info = styled.div`
  margin-left: 20px;
  display: flex;
  flex-direction: column;
  justify-content: flex-start;
`;

const NameText = styled.div`
  color: #4a4e4d;
  font-family: Roboto;
  font-size: 32px;
  font-style: normal;
  font-weight: 700;
  line-height: normal;
`;

const TextWithIcon = styled.div`
  display: flex;
  align-items: center;
  color: #4a4e4d;
  font-family: Roboto;
  font-size: 24px;
  font-style: normal;
  font-weight: 400;
  line-height: 40px;
  gap: 8px; /* 아이콘과 텍스트 간격 */
`;

export default function MyInfo() {
  return (
    <Box>
      <Image />

      <Info>
        <NameText>임세연</NameText>
        <TextWithIcon>
          {/* 이메일 아이콘 */}
          <MailOutlineIcon style={{ fontSize: 24 }} />
          <span>iteyeonn@gmail.com</span>
        </TextWithIcon>
        <TextWithIcon>
          {/* Github 아이콘 */}
          <IconGithub size="24" />
          <span>github 주소</span>
        </TextWithIcon>
        <TextWithIcon>
          <span>ㅇㅇ 대학교</span>
        </TextWithIcon>
        <TextWithIcon>
          <span>2002.12.02</span>
        </TextWithIcon>
      </Info>
    </Box>
  );
}
